import { Question } from "./components/Question.js";
import { QuestionNavbar } from "../QuestionNavbar.js";

export const Study4 = () => {
  return (
    <div className="questions">
      <QuestionNavbar />
      <Question
        title={
          "Hienoa, että otat tehtävän vastaan! Minkä näkökulman valitset jutun lähtökohdaksi? Kuka pääsee ääneen? Kenelle juttu tehdään? ​​"
        }
        options={[
          { value: "Aiheeseen liittyen on mahdollista tuoda esiin useita erilaisia ääniä ja näkökulmia.​", navigate: "study3" },
          { value: "Haluan huomioida näkökulman tai kohderyhmän, jota ei ole vielä tuotu esiin valtavirtamediassa.​", navigate: "study4" },
        ]}
      />
    </div>
  );
};
